import React from "react";
import Navbar from "./Navbar";
import { BrowserRouter, Link, Route, Routes } from "react-router-dom";

const Header = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" />
      </Routes>
    </BrowserRouter>
  );
};

export default Header;
